DROP TABLE IF EXISTS `nContacts`;
CREATE TABLE `nContacts` (
  `ID` INT NOT NULL AUTO_INCREMENT,
  `LastName` VARCHAR(50) CHARACTER SET utf8,
  `FirstName` VARCHAR(50) CHARACTER SET utf8,
  `Email` VARCHAR(50) CHARACTER SET utf8,
  `Email2` VARCHAR(255) CHARACTER SET utf8,
  `Parent` VARCHAR(50) CHARACTER SET utf8,
  `Phone` VARCHAR(25) CHARACTER SET utf8,
  `AltPhone` VARCHAR(25) CHARACTER SET utf8,
  `Address` VARCHAR(255) CHARACTER SET utf8,
  `City` VARCHAR(50) CHARACTER SET utf8 DEFAULT 'Natick',
  `State` VARCHAR(50) CHARACTER SET utf8 DEFAULT 'MA',
  `ZIP` VARCHAR(255) CHARACTER SET utf8 DEFAULT '01760',
  `Notes` LONGTEXT CHARACTER SET utf8,
  `Birthday` DATETIME,
  `StartDate` DATETIME,
  `NewRank` VARCHAR(255) CHARACTER SET utf8,
  `BeltSize` DOUBLE,
  `CurrentRank` VARCHAR(255) CHARACTER SET utf8,
  `LastPromoted` DATETIME,
  `ReferredBy` VARCHAR(255) CHARACTER SET utf8,
  `ConsentToPublicPictures` BIT DEFAULT 0,
  `Attachments` TEXT CHARACTER SET utf8,
  `InstructorPaymentFree` BIT DEFAULT 0,
  `ContactType` VARCHAR(255) CHARACTER SET utf8 DEFAULT 'Student',
  `include` BIT DEFAULT 0,
  `InstructorFlag` BIT DEFAULT 0,
  `quickbooklink` VARCHAR(255) CHARACTER SET utf8,
  `instructorTitle` VARCHAR(255) CHARACTER SET utf8,
  `testDate` VARCHAR(255) CHARACTER SET utf8,
  `testTime` VARCHAR(255) CHARACTER SET utf8,
  `bdayinclude` BIT DEFAULT 0,
  `signupDate` DATETIME,
  `sex` VARCHAR(255) CHARACTER SET utf8 DEFAULT 'Unknown',
  `medicalConcerns` LONGTEXT CHARACTER SET utf8,
  `GuiSize` VARCHAR(255) CHARACTER SET utf8 DEFAULT '1',
  `ShirtSize` VARCHAR(255) CHARACTER SET utf8 DEFAULT 'Adult L',
  `phoneExt` VARCHAR(255) CHARACTER SET utf8,
  `altPhoneExt` VARCHAR(255) CHARACTER SET utf8,
  `CurrentReikiRank` VARCHAR(255) CHARACTER SET utf8,
  `StudentSchool` VARCHAR(255) CHARACTER SET utf8,
  `EmergencyContact` VARCHAR(255) CHARACTER SET utf8,
  `sendWelcomeCard` BIT DEFAULT 0,
  `dateEntered` DATETIME,
  `dateInactive` DATETIME,
  `CurrentIARank` VARCHAR(255) CHARACTER SET utf8,
  `ReadyForNextRank` INT DEFAULT 0,
  `nextScheduledTest` VARCHAR(50) CHARACTER SET utf8,
  `upgrade` INT DEFAULT 0,
  `SSMA_TimeStamp` LONGBLOB NOT NULL,
  PRIMARY KEY (`ID`),
  INDEX `nContacts$City` (`City`),
  INDEX `nContacts$Contactszip` (`ZIP`),
  INDEX `nContacts$ContactType` (`ContactType`),
  INDEX `nContacts$ContactTypeLastName` (`ContactType`, `LastName`),
  INDEX `nContacts$currrank` (`CurrentRank`),
  INDEX `nContacts$First Name` (`FirstName`),
  INDEX `nContacts$First NameLastName` (`FirstName`, `LastName`),
  INDEX `nContacts$LastName` (`LastName`),
  INDEX `nContacts$LastNameFirstName` (`LastName`, `FirstName`),
  INDEX `nContacts$StateProvince` (`State`),
