DROP TABLE IF EXISTS `npayments`;
CREATE TABLE `npayments` (
  `PaymentClassName` VARCHAR(255) CHARACTER SET utf8 NOT NULL,
  `NumberOfMembers` VARCHAR(255) CHARACTER SET utf8 DEFAULT '1',
  `LastPaymentdate` DATETIME,
  `Nextpaymentdate` DATETIME,
  `paymenttype` VARCHAR(255) CHARACTER SET utf8 DEFAULT 'Check',
  `PaymentNotes` LONGTEXT CHARACTER SET utf8,
  `PaymentPlan` VARCHAR(255) CHARACTER SET utf8 DEFAULT 'Monthly',
  `PaymentAmount` DECIMAL(19,4),
  `PriceSetby` VARCHAR(255) CHARACTER SET utf8 DEFAULT 'Mark',
  `Pricesetdate` DATETIME,
  `SSMA_TimeStamp` LONGBLOB NOT NULL,
  PRIMARY KEY (`PaymentClassName`),
  INDEX `npayments$NumberOfMembers` (`NumberOfMembers`),
  INDEX `npayments$PaymentClassName` (`PaymentClassName`),
  INDEX `npayments$paymenttype` (`paymenttype`)
) ENGINE=InnoDB;
